package javapatternquestioinANDlogicqq;

public class squrepattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j;
		for(i=1; i<=5; i++)//rows 
		{
		for(j=1;j<=5; j++)//coloums
		{
			System.out.print("*");
		}
		System.out.println();
		
	}

	}
}
